// n8n Code Node - Transform Binary Data to Schema

// Get the binary data from the input
const binaryData = $('When Executed by Another Workflow').item.binary.data;

// Extract file information
const fileInfo = {
  fileName: binaryData.fileName,
  fileExtension: binaryData.fileExtension,
  mimeType: binaryData.mimeType,
  fileSize: binaryData.fileSize,
  fileSizeFormatted: formatFileSize(binaryData.fileSize)
};

// Helper function to format file size
function formatFileSize(bytes) {
  if (bytes === 0) return '0 Bytes';

  const k = 1024;
  const sizes = ['Bytes', 'KB', 'MB', 'GB', 'TB'];
  const i = Math.floor(Math.log(bytes) / Math.log(k));

  return Math.round((bytes / Math.pow(k, i)) * 100) / 100 + ' ' + sizes[i];
}

// Return the structured data
return {
  json: fileInfo
};

const items = $input.all();
const out = [];

for (const item of items) {
  const text =
    item.json?.candidates?.[0]?.content?.parts?.find(p => typeof p.text === 'string')?.text;

  if (!text) {
    out.push({ json: { error: 'No text field found in item' } });
    continue;
  }

  let parsed;
  try {
    parsed = JSON.parse(text);
  } catch (e) {
    const start = text.indexOf('{');
    const end = text.lastIndexOf('}');
    if (start !== -1 && end !== -1 && end > start) {
      parsed = JSON.parse(text.slice(start, end + 1));
    } else {
      out.push({ json: { error: 'Invalid JSON in text' } });
      continue;
    }
  }

  out.push({ json: parsed });
}

return out;

